-- Backfill tvl by chain by adding up tvl of vaults
INSERT INTO tvl_by_chain (chain_id, t, total, vault, gov, clm)
    (SELECT tvm.chain_id,
            tvls.t,
            SUM(tvls.val)                                                  AS total,
            SUM(CASE WHEN tvm.category = 'vault' THEN tvls.val ELSE 0 END) AS vault,
            SUM(CASE WHEN tvm.category = 'gov' THEN tvls.val ELSE 0 END)   AS gov,
            SUM(CASE WHEN tvm.category = 'clm' THEN tvls.val ELSE 0 END)   AS clm
     FROM tvls
              JOIN
          vault_ids vi ON vi.id = tvls.vault_id
              JOIN
          temp_vaults_meta tvm ON tvm.id = vi.vault_id
              AND tvm.first_seen <= tvls.t
              AND (tvm.last_seen >= tvls.t OR tvm.deleted = false)
     GROUP BY tvm.chain_id, tvls.t);

ANALYSE tvl_by_chain;
